import React from 'react'
const a = ["a", "b", "c", "d", "e", "f", "g", "h", "i", "j", "k", "l", "m", "n", "o", "p", "q", "r", "s", "t", "u", "v", "w", "x", "y", "z"]

function VerbList() {
    return (
        <div className="allBody">
            <p> All alphabete verbs</p>
            {
                a.map((element, index) => {
                    return (<a href="/" key={index}> {element}</a>)
                })
            }
        </div>
    )
}

export default VerbList
